import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import CreateArea from "./CreateArea";
import Habit from "./Habit";
import Title from "./Title";

function App() {
  return (
    <div>
      <Header />
      <Title />
      <CreateArea />
      <Habit />
      <Footer />
    </div>
  );
}

export default App;
